        //   this.cekwarna();
        // },
        methods: {
          cekbutton: function () {
            if (this.cek_membransel == "membransel") {
              this.membransel = true;
              this.point += 1;
            }
            if (this.cek_sitoskeleton == "sitoskeleton") {
              this.sitoskeleton = true;
              this.point += 1;
            }
            if (this.cek_sitoplasma == "sitoplasma") {
              this.sitoplasma = true;
              this.point += 1;
            }
            if (this.cek_ribosom == "ribosom") {
              this.ribosom = true;
              this.point += 1;
            }
            if (this.cek_intisel == "intisel") {
              this.intisel = true;
              this.point += 1;
            }
            if (this.cek_RE == "RE") {
              this.RE = true;
              this.point += 1;
            }
            if (this.cek_sentriol == "sentriol") {
              this.sentriol = true;
              this.point += 1;
            }
            if (this.cek_mitokondria == "mitokondria") {
              this.mitokondria = true;
              this.point += 1;
            }
            if (this.cek_lisosom == "lisosom") {
              this.lisosom = true;
              this.point += 1;
            }
            if (this.cek_badangolgi == "badangolgi") {
              this.badangolgi = true;
              this.point += 1;
            }

            if (this.point == 10) {
              swal({
                text: "Selamat anda mendapat skor penuh" + " " + this.point,
                icon: "success",
                button: "OK",
              });
            } else {
              swal({
                text: "Skor anda" + " " + this.point,
                icon: "success",
                button: "OK",
              });
            }

            // swal("point anda" + " " + this.point);
            this.point = 0;
          },
